import './App.css';
import WhoisAPI from './whois-api'


function App() {
  return (
    <div className="App">
      <header className="App-header"> 
       { searchBox() } 
      </header>
    </div>
  );
}

function searchBox() {
  const whois = new WhoisAPI();
  return (
    <form action={whois.getDomainInfo()}>
      <label>
        WHOIS IP or Domain Lookup: <br/>
        <input type="text" name="domain" placeholder="e.g. www.google.com..."/>
      </label>
      <button type="submit">Search</button>
    </form>
  )
}

export default App;
